import React from "react";
import PropTypes from "prop-types";
import { Box } from "@material-ui/core";

function Hero(props) {
  const useStyles = makeStyles((theme) => ({
    root: {
      backgroundColor: theme.palette.primary.light,
      height: "200px",
      width: "100%",
    },
  }));
  return <Box></Box>;
}

Hero.propTypes = {};

export default Hero;
